"<div>\n<i class=\"NoteType\">\nResearch\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<span style=\"font-family:'Libre Baskerville';\">Appears presumably in the census records of 1820 and 1830 for Edmund Durfee, but there are no names as it is just a tally of the age of persons in the family.</span>\n</p>\n</div>\n</div>",
