"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<span style=\"font-family:'Libre Baskerville';\">There is a discrepancy in the records and the history passed down by the grandchildren. 1852 is what the record looks like, but the history says that Elizabeth was actually the first child. They say that the family lived in Lowestoft only for a short time when Elizabeth was born and died, then they moved back to Wymondham where the next children were born. </span>\n</p>\n<p>\n<span style=\"font-family:'Libre Baskerville';\">If William John was born in July of 1844, then perhaps Elizabeth was born in 1842-43? The puzzling thing is the record, which claims she was christened Jan. 5, 1852 and died Jan 21, 1852. </span>\n</p>\n</div>\n</div>",
